export const lightTheme = {
  background: "#f9f9f9",
  text: "#333",
  tableHeader: "#ececec",
  tableBorder: "#ddd",
  rowBackground: "#fff",
  rowText: "#333",
  headerText: "#000"
};

export const darkTheme = {
  background: "#1e1e1e",
  text: "#f0f0f0",
  tableHeader: "#333",
  tableBorder: "#444",
  rowBackground: "#2b2b2b",
  rowText: "#f0f0f0",
  headerText: "#fff"
};
